import React, { Component } from "react";

class About extends Component{
    render(){
        return(
            <div>
                <h2>About Random User</h2>
                <p>RANDOM USER GENERATOR A free, open-source API for generating random user data. Like Lorem Ipsum, but for people.</p>
            </div>
        )
    }
}

export default About;
